{"metrics":{"avgBasketPrice":84.99,"coPurchaseItems":[{"gross_price":24.0,"item_description":"15 Ibu 4,7% Abv Estilo tradicional alemão adequado ao paladar do brasileiro. Presença de lúpulos da República Tcheca e Malte tipo Pilsen da Alemanha. O processo de lupulagem é feito com extrema maestria, o qual garante aroma e sabor suave a este estilo.","item_id":"32ca5068-00df-48a9-a52f-f270b0968196","item_name":"Campinas Pilsen - Pet 1 litro","merchant_id":"94b56c8b-672b-40c5-aa18-af8fcb6542bf"},{"gross_price":29.0,"item_description":"35 Ibu e 5,3% Abv Notas de caramelo muito presentes devido aos maltes ingleses com lúpulos americanos conferindo aroma cítrico, mas sem sobrepor a presença de malte. Estilo muito apreciado na Europa sendo um dos estilos mais conhecidos entre as cervejas do tipo Ale. Sugestão de harmonização: Hambúrguer, Churrasco Brasileiro, Bife Grelhado, Cordeiro Grelhado, Frango Assado, Frango a passarinho.","item_id":"dffd201f-729c-498c-a6e3-88dbc1f46391","item_name":"Campinas Amber Ale - Pet 1 Litro","merchant_id":"94b56c8b-672b-40c5-aa18-af8fcb6542bf"},{"gross_price":32.0,"item_description":"7,5% Abv e 70 Ibu Uma porrada nos seu sentidos! Essa é a Eldorado Punch IPA – cheia de aromas, sabores e amargor. Essa cerveja da Cervejaria Campinas apresenta uma cor bem dourada e é considerada forte, tanto em amargor quanto no teor alcóolico, mas, ao mesmo tempo é aromática com notas de frutas amarelas como pera, pêssego, nectaria e melão. Sugestão de harmonização: Hamburguer, pimentão recheado, nachos, chouriço e carnes vermelhas em geral","item_id":"56edf80e-ca1e-4267-b01a-bd02f4543e31","item_name":"Campinas Eldorado Punch IPA - Pet 1 litro","merchant_id":"94b56c8b-672b-40c5-aa18-af8fcb6542bf"},{"gross_price":32.0,"item_description":"4% Abv e 5 Ibu Sour Ale é um estilo de cerveja ácida, portanto seu Ph é bem baixo. As frutas e também malte de trigo tem função de suavizar além de garantir refrescância e sabor. Silvestre Sour pode ser uma cerveja sazonal até nas frutas numa combinação entre amora, framboesa, mirtilo e morango. Experimente o diferente","item_id":"4fff9060-1191-4213-80c2-f186a197ca4f","item_name":"Campinas Silvestre Sour - Pet 1 litro","merchant_id":"94b56c8b-672b-40c5-aa18-af8fcb6542bf"},{"gross_price":28.0,"item_description":"35 Ibu e 5,1% Abv A base do estilo é uma Czech Premium Pale Lager, o que seria a clássica Pilsen fabricada na República Tcheca, mas com um lúpulo americano chamado Citra, que confere aroma cítrico e amargor na medida certa. O lúpulo Citra confere aromas que fazem lembrar manga, melão e até pêssego.","item_id":"26dd440d-2162-4854-85ef-1902c68ae4d0","item_name":"Campinas Hop Lager - Pet 1 litro","merchant_id":"94b56c8b-672b-40c5-aa18-af8fcb6542bf"},{"gross_price":41.0,"item_description":"6,3% Abv e 30 Ibu Medalha de Prata na Copa Poa 2019. New England ou Hazy IPA é o estilo, demos a ela o nome de Videnz: amarela e turva, devido à grande quantidade de lúpulo com 03 adições no Dry Hop, além de flocos de aveia. Seu aroma é muito intenso e isso é devido ao triplo Dry Hop, feito em grandes quantidades dos lúpulos Citra, Mosaic e Simcoe. Maior parte do lúpulo foi utilizado no dry hop e por isso gosto e aroma intenso de lúpulo. Baixo amargor.","item_id":"f6b119d2-a4a9-456c-b442-e7b7b5175cf7","item_name":"Campinas Videnz Hazy IPA - Pet 1 litro","merchant_id":"94b56c8b-672b-40c5-aa18-af8fcb6542bf"},{"gross_price":28.0,"item_description":"4,4% Abv e 40 Ibu Derivada do estilo IPA e com elevadíssimo drinkability a Session IPA tem teor alcoólico reduzido porém sem perder o amargor e aroma cítrico que são característicos da escola americana","item_id":"5e123dce-92fb-4519-a0be-5589be532280","item_name":"Campinas Session IPA Todo Dia - Pet 1 litro","merchant_id":"94b56c8b-672b-40c5-aa18-af8fcb6542bf"},{"gross_price":8.0,"item_description":"Lata 350ml","item_id":"70472609-a513-4e07-a138-7320c9259643","item_name":"Coca Cola Zero Lata 350ml","merchant_id":"94b56c8b-672b-40c5-aa18-af8fcb6542bf"},{"gross_price":29.0,"item_description":"26 Ibu e 6,0% Abv Cerveja Andarilha receita legítima inglesa usando lúpulos ingleses de aroma amadeirado e cinco diferentes maltes, além de flocos de aveia para conferir cremosidade. De aroma e gosto remetendo ao café essa cerveja tem baixo amargor e copo médio.","item_id":"649ea84c-7469-4260-8c8a-6c72985e51a6","item_name":"Campinas Andarilha Oatmeal Stout - Pet 1 litro","merchant_id":"94b56c8b-672b-40c5-aa18-af8fcb6542bf"},{"gross_price":35.0,"item_description":"6,5% vol, 8 Ibu;

