{"metrics":{"avgBasketPrice":134.71,"coPurchaseItems":[{"gross_price":18.9,"item_description":"Fatia de salmão fresco por cima uma bolinha de arroz japonês, salmão maçaricado e regado com leve fio de azeite trufado e flor de sal.","item_id":"6862a681-7ff5-4de1-a5d9-4d100f2107b3","item_name":"Niguiri de Salmão Maçaricado Trufado (6 un)","merchant_id":"26587bf4-483a-49ce-a6e0-b0a6a313772c"},{"gross_price":26.9,"item_description":"10 unidades de delicados enrolados de Hot-Roll, cuidadosamente recheados com salmão finamente grelhado e temperado com ingredientes frescos e um tempero exclusivo, criado especialmente para exaltar a essência do peixe. A textura cremosa do cream cheese adiciona uma camada de sabor extravagante, enquanto um finalizador de fio de tarê agrega uma doçura sutil, criando uma explosão de sabores irresistíveis. Uma verdadeira experiência culinária!

Importante: Imagem meramente ilustrativa. Molho não acompanha a porção.","item_id":"437a9d4f-6ad1-4d3e-9216-fba027b315f3","item_name":"Hot-Roll de Salmão Grelhado (10 un)","merchant_id":"26587bf4-483a-49ce-a6e0-b0a6a313772c"},{"gross_price":19.0,"item_description":"Uma composição harmoniosa de salmão fresco, cuidadosamente envolvido numa delicada bolinha de arroz. Acrescentamos um topping de salmão de alta qualidade, que intensifica o sabor inconfundível do mar. Para finalizar, uma generosa camada de cream cheese, que adiciona um toque suave e cremoso a cada mordida. Uma delícia irresistível que vai encantar o seu paladar.","item_id":"db56427e-8a2d-417c-bf03-dac323a9f724","item_name":"Jow de Salmão (6 un)","merchant_id":"26587bf4-483a-49ce-a6e0-b0a6a313772c"},{"gross_price":3.0,"item_id":"059a98ba-2a23-4c73-bee4-2c0ae039091d","item_name":"** Extra Molho Tarê (30ml) **","merchant_id":"26587bf4-483a-49ce-a6e0-b0a6a313772c"},{"gross_price":16.0,"item_description":"Desfrute de nosso Carpaccio de Salmão, um prato requintado que consiste em dez fatias delicadamente finas de salmão fresco, cuidadosamente regadas com nosso autêntico molho Ponzu caseiro. Para aprimorar ainda mais o sabor, o prato é salpicado com a exótica pimenta Togarashi japonesa, que confere um toque levemente picante. Completando a obra, ingredientes importados primorosamente selecionados e uma base de shoyo de qualidade superior. Um prato que é uma verdadeira celebração dos sabores do Oriente.","item_id":"1da0013e-b4ef-4e13-baae-623ac6064e08","item_name":"Carpaccio de Salmão (10 fatias)","merchant_id":"26587bf4-483a-49ce-a6e0-b0a6a313772c"},{"gross_price":24.9,"item_description":"8 deliciosas fatias de atum maçaricado, regado com azeite trufado e flor de sal.","item_id":"1ddb80d4-b037-420c-afc5-628d95003eb7","item_name":"Sashimi de Atum Trufado Maçaricado (8 fatias)","merchant_id":"26587bf4-483a-49ce-a6e0-b0a6a313772c"},{"gross_price":65.5,"item_description":"Escolha seu combo, do seu jeito com a sua fome =)","item_id":"2a5a5b7f-af58-4968-9f85-6587147faeaa","item_name":"Combo 47 peças","merchant_id":"26587bf4-483a-49ce-a6e0-b0a6a313772c"},{"gross_price":13.9,"item_description":"Uma deslumbrante entrada oriental. São irresistíveis guiozas meticulosamente fritos até atingirem uma textura divinamente crocante. Cada um é cuidadosamente temperado com nosso exclusivo e leve tempero da casa, realçando o sabor autêntico e proporcionando uma experiência culinária memorável.

