{"metrics":{"avgBasketPrice":92.95,"coPurchaseItems":[{"gross_price":68.17,"item_description":"","item_id":"8da8ac73-fbbd-4c1c-acda-5416818bc1e3","item_name":"Probiótico Enterogermina Plus 5 Frascos","merchant_id":"721872d8-a13e-4fb2-93b8-3b5a2c08b550"},{"gross_price":26.12,"item_description":"","item_id":"39962891-831d-4a37-9a14-0a1ef28f7a94","item_name":"Escova de Dente Whitening Colgate 2un","merchant_id":"721872d8-a13e-4fb2-93b8-3b5a2c08b550"},{"gross_price":22.72,"item_description":"Unidade 1un","item_id":"fda7f196-0af6-4cf5-a04c-8eb3f76e7c5b","item_name":"Bolsa Térmica Gel Grande Termogel 700ml","merchant_id":"721872d8-a13e-4fb2-93b8-3b5a2c08b550"},{"gross_price":18.17,"item_description":"Colgate Total Clean Mint, com prevenção ativa, é a escolha ideal para quem busca o melhor creme dental com flúor e proteção completa. A nova versão do Colgate Total 12 combate as bactérias que são a causa raiz de mau hálito, cárie, placa dentária, tártaro, erosão do esmalte, sensibilidade, acúmulo de bactérias na gengiva e manchas nos dentes.

